/**
 * Returns true iff they are equal as defined by
 * {@link #equals(double,double,int) equals(x, y, 1)}.
 *
 * @param x first value
 * @param y second value
 * @return {@code true} if the values are equal.
 */
public static boolean equals(double x, double y) {
    return (Double.doubleToLongBits(x) == Double.doubleToLongBits(y)) && !Double.isNaN(x);
}

/**
 * Returns true if the two double values are equal as defined by
 * {@link #equals(double, double, int) equals(x, y, 1)}.
 * This method will return false if either x or y is NaN.
 *
 * @param x first value
 * @param y second value
 * @return {@code true} if the values are equal and not NaN.
 */
public static boolean equals(double x, double y) {
    return !(Double.isNaN(x) || Double.isNaN(y)) && x == y;
}

/**
 * Returns true if the specified values are equal based on a tolerance of 1.
 *
 * @param x first value
 * @param y second value
 * @return {@code true} if the values are equal within the tolerance.
 */
public static boolean equals(double x, double y) {
    return equals(x, y, 1);
}

/**
 * Returns true if the double values x and y are equal. NaN values are considered unequal.
 *
 * @param x first value
 * @param y second value
 * @return {@code true} if the values are equal, {@code false} otherwise.
 */
public static boolean equals(double x, double y) {
    return x == y && !Double.isNaN(x) && !Double.isNaN(y);
}
